import React from "react";
import { FaArrowRight } from "react-icons/fa";
import "./LifeAtManet.css";

const LifeAtManet = () => {
  const cards = [
    {
      title: "Card 1",
      buttons: ["Explore", "Join Us", "Learn More"],
    },
    {
      title: "Card 2",
      buttons: ["Discover", "Apply Now", "See Events"],
    },
    {
      title: "Card 3",
      buttons: ["Visit", "Sign Up", "Read More"],
    },
  ];

  return (
    <section className="lifeatmanet-section">
      <div className="container">
        <h2 className="title">Life at Manet</h2>
        <p className="subtitle">Experience the culture and opportunities</p>

        <div className="cards-container">
          {cards.map((card, idx) => (
            <div key={idx} className="card">
              <h3>{card.title}</h3>
              <div className="buttons-container">
                {card.buttons.map((btnText, i) => (
                  <button key={i} className="card-button">
                    <FaArrowRight className="arrow-icon" />
                    <span>{btnText}</span>
                  </button>
                ))}
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default LifeAtManet;
